import styled from 'styled-components';

export const HomeWrapper = styled.div`
	width: 960px;
	margin: 0 auto;
	height: 300px;
	overflow: hidden;
`;

export const HomeLeft = styled.div`
	margin-left: 15px;
	margin-top: 30px;
	float: left;
	width: 625px;
	.banner-img {
		width: 625px;
		height: 240px;
	}
`;

export const HomeRight = styled.div`
	width: 240px;
	float: right;
`;
